/**
 * Get all sample emails for a specific user
 */
export function getSampleEmailsForUser(userId: string): SampleEmail[] {
  return sampleEmails.filter(email => email.userId === userId);
}

/**
 * Get a specific sample email by user and format
 */
export function getSampleEmail(userId: string, format: 'text' | 'html'): SampleEmail | undefined {
  return sampleEmails.find(email => email.userId === userId && email.format === format);
}

/**
 * Get all sample emails
 */
export function getAllSampleEmails(): SampleEmail[] {
  return sampleEmails;
}
